function didYouMean($validList, $testWord) {
    // check if $testWord is in $validList
    if (in_array($testWord, $validList)) {
        return $testWord;
    }
    $matches = [];
    
    foreach ($validList as $v) {
        if (levenshtein($v, $testWord) == 1) {
            $matches[] = $v;
        }
    }
    
    if (count($matches) == 1) {
        return $matches[0];
    }
    
    return $testWord;
}

